  6,\n\t\"tags\": [],\n\t\"title\": \"Vertebrae classification models - Validating
  classification models that use morphometrics to identify ancient salmonid (Oncorhynchus
  spp.) vertebrae to species\",\n\t\"tracking_summary\": {\n\t\t\"total\": 4,\n\t\t\"recent\":
  0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-03-21T22:24:16.281622\",\n\t\"name\": \"vertebrae-classification-models-validating-classification-models-that-use-morphometrics-to-iden\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Using morphometric characteristics of modern
  salmonid (Oncorhynchus spp.) vertebrae, we have developed classification models
  to identify salmonid vertebrae to the species level with relatively low error rates.
  This is a study to validate the performance of our classification models on ancient
  salmonid specimens using analysis of ancient DNA. We have putatively identified
  a sample of ancient (ca. 1000 to 2900 ybp) vertebrae (from the Wenatchee River basin)
  to species with our models. Using molecular markers to identify the ancient vertebrae
  to species, we will be able to evaluate the performance of our models that use vertebral
  morphology for species identification. If identification methods that are based
  on vertebral morphology perform successfully, we will have a rapid, low cost, nondestructive
  method to identify ancient salmonid vertebrae. If applied to midden sites throughout
  the Columbia River basin, and potentially to other river systems draining into the
  Pacific Ocean, we will improve our understanding of historical anadromous salmonid
  occupancy and have a more complete picture of historical population and ESU structure.
  Additionally, the results of this work have the potential to make a significant
  contribution to inland and coastal anthropological/archaeological investigations.
  Collaborators include: Virginia Butler (Portland State University, Dept. of Anthropology),
  Harriet Huber (AFSC), and Dongya Yang (Simon Fraser University, Ancient DNA Laboratory).nnAncient
  vertebrae measurements.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
